        Vue.component('ai-skill-capacity-forecast-pie-component',{
            template: `<div style="width:100%;height:380px;"></div>`,
            props:{
                model: String
            },
            data: function(){
                return {
                    chart: Object,
                    dataset: Array,
                    option: Object,
                }
            },
            created: function(){
                var self = this;

                eventHub.$on("chart-resize",self.resize);

            },
            mounted: function () {
                var self = this;

                self.$nextTick(function () {

                    self.chart = echarts.init(self.$el);
                    
                    self.init();

                    self.chart.setOption(self.option);
                })
            },
            methods: {
                init: function() {
                    var self = this;

                    var renderItem = function (params, api) {
                        var values = [api.value(0), api.value(1)];
                        var coord = api.coord(values);
                        var size = api.size([1, 1], values);
                        return {
                            type: 'sector',
                            shape: {
                                cx: params.coordSys.cx,
                                cy: params.coordSys.cy,
                                r0: coord[2] - size[0] / 2,
                                r: coord[2] + size[0] / 2,
                                startAngle: coord[3] - size[1] / 2,
                                endAngle: coord[3] + size[1] / 2
                            },
                            style: api.style({
                                fill: api.visual('color')
                            })
                        };
                    };

                    var hours = ['2300', '2200', '2100', '2000', '1900',
                            '1800', '1700', '1600', '1500', '1400', '1300',
                            '1200', '1100', '1000', '900', '800', '700',
                            '600', '500', '400', '300', '200', '100'];
                    var daysObj = {
                                    'biz': ['MATRIX','GTS','CAST','TWS','GCG','MAXIMO','MAIL'],
                                    'app': ['cassandra', 'etcd','queue', 'web','db2','oracle','weblogic'],
                                    'performance': ['mxsvr201', 'mxsvr211', 'mxsvr221','mxsvr231', 'mxsvr232', 'mxsvr233', 'mxsvr241'],
